import React, { useEffect, useState } from "react";

export default function ProfilePage() {
  const storedUser = JSON.parse(localStorage.getItem("user"));
  const token = localStorage.getItem("token");

  const [user, setUser] = useState(null);
  const [preferences, setPreferences] = useState([]);
  const [itineraries, setItineraries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [editing, setEditing] = useState(false);
  const preferenceOptions = ["Nature", "Culture", "Food", "History", "Adventure"];

  useEffect(() => {
    if (!storedUser?.email || !token) return;

    fetch(`http://localhost:5000/api/users/email/${encodeURIComponent(storedUser.email)}`, {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then(res => res.json())
      .then(data => {
        setUser(data);
        setPreferences(Array.isArray(data.preferences) ? data.preferences : []);
        fetchItineraries(data.id); // <-- load itineraries for this user
        setLoading(false);
      })
      .catch(err => {
        console.error("Error fetching user:", err);
        setLoading(false);
      });
  }, [storedUser?.email, token]);

  const fetchItineraries = async (userId) => {
    try {
      const res = await fetch(`http://localhost:5000/api/itineraries/${userId}`);
      const data = await res.json();
      setItineraries(data);
    } catch (err) {
      console.error("Error fetching itineraries:", err);
    }
  };

  const handleDeleteItinerary = async (id) => {
    if (!window.confirm("Delete this itinerary?")) return;

    try {
      await fetch(`http://localhost:5000/api/itineraries/${id}`, { method: "DELETE" });
      setItineraries(prev => prev.filter(i => i.id !== id));
    } catch (err) {
      console.error("Error deleting itinerary:", err);
    }
  };

  const handleSaveItinerary = async () => {
    const name = prompt("Enter a name for this itinerary:");
    const route_data = { sampleRoute: "Example route data" }; // Replace with actual route data

    try {
      const res = await fetch("http://localhost:5000/api/itineraries", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ user_id: user.id, name, route_data }),
      });

      const data = await res.json();
      if (res.ok) {
        alert("Itinerary saved!");
        fetchItineraries(user.id);
      } else {
        alert(`Error: ${data.message}`);
      }
    } catch (err) {
      console.error("Error saving itinerary:", err);
    }
  };

  if (loading || !user) return <div style={{ padding: "24px" }}>Loading...</div>;

  return (
    <div style={{ padding: "24px", maxWidth: "600px", margin: "0 auto" }}>
      <h1>Profile</h1>
      <div style={{ background: "#fff", padding: "20px", borderRadius: "16px" }}>
        <p><strong>Username:</strong> {user.username}</p>
        <p><strong>Email:</strong> {user.email}</p>
        <p><strong>Full Name:</strong> {`${user.first_name || ""} ${user.middle_name || ""} ${user.last_name || ""}`}</p>
        <p><strong>Age:</strong> {user.age || "Not provided"}</p>

        <div>
          <strong>Preferences:</strong>
          <ul>
            {preferences.length > 0 ? preferences.map((p, i) => <li key={i}>{p}</li>) : <li>No preferences set.</li>}
          </ul>
        </div>

        <hr style={{ margin: "20px 0" }} />

        <div>
          <h3>My Itineraries</h3>
          {itineraries.length === 0 ? (
            <p>No itineraries saved yet.</p>
          ) : (
            <ul>
              {itineraries.map((it) => (
                <li key={it.id}>
                  <strong>{it.name}</strong> <br />
                  <small>{new Date(it.created_at).toLocaleString()}</small>
                  <br />
                  <button onClick={() => handleDeleteItinerary(it.id)} style={{ marginTop: "6px" }}>
                    Delete
                  </button>
                </li>
              ))}
            </ul>
          )}
          <button onClick={handleSaveItinerary} style={{ marginTop: "10px" }}>
            Save New Itinerary
          </button>
        </div>
      </div>
    </div>
  );
}
